import AppLayout from "../componets/AppLayout";
import React from "react";

const Signup = () => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>NodeBird</title>
      </Head>
      <AppLayout>회원가입 페이지</AppLayout>
    </>
  );
};

export default Signup;
